const axios = require("axios")
const sharp = require('sharp')
const {bot} = require('./bot');

const mustacheImage = ""

async function handleNewPhoto(chatId, fileUrl) {
    try {
        const response = await axios.get(fileUrl, {responseType: 'arraybuffer'})
        const photo = Buffer.from(response.data, 'binary').toString('base64')
        const faces = await findFaces(photo)
        const mustachedPhoto = await putMustache(photo, faces)
        await bot.telegram.sendMessage(chatId, "Отмусташено!")
        await bot.telegram.sendPhoto(chatId, {source: mustachedPhoto})
    } catch (e) {
        console.error(e)
        await bot.telegram.sendMessage(chatId, "Никак не отмусташить :(")
    }
}

async function putMustache(photo, faces) {
    const mustaches = await generateMustaches();
    return await sharp(Buffer.from(photo, 'base64'))
        .composite(mustaches)
        .toBuffer()

    async function generateMustaches() {
        const mustaches = []
        for (const face of faces) {
            const vertices = face.boundingBox.vertices
            const xMin = parseInt(vertices[0].x) ? parseInt(vertices[0].x) : 0
            const xMax = parseInt(vertices[2].x) ? parseInt(vertices[2].x) : 0
            const yMin = parseInt(vertices[0].y) ? parseInt(vertices[0].y) : 0
            const yMax = parseInt(vertices[2].y) ? parseInt(vertices[2].y) : 0
            const x = xMin
            const y = yMin + Math.trunc((yMax - yMin) * 0.5)

            const mustache = await sharp(Buffer.from(mustacheImage, 'base64'))
                .resize(xMax - xMin)
                .toBuffer()
            mustaches.push({
                input: mustache,
                top: y,
                left: x
            })
            console.log("Growing new mustache at %s:%s (yMin/yMax: %s/%s)", x, y, yMin, yMax)
        }
        return mustaches
    }
}

async function findFaces(photo) {
    const answer = await axios
        .post("https://vision.api.cloud.yandex.net/vision/v1/batchAnalyze",
            {
                'folderId': process.env.folder_id, "analyze_specs": [{
                    "content": photo,
                    "features": [{
                        "type": "FACE_DETECTION"
                    }]
                }]
            },
            {
                headers: {
                    'Content-Type': 'application/json',
                    'Authorization': 'Api-Key ' + process.env.api_key
                }
            })

    const faces = answer.data.results[0].results[0].faceDetection.faces
    if (faces == null) {
        throw new Error("Faces not found")
    }
    console.log("Found %s faces", faces.length)
    return faces;
}

module.exports = {
    handleNewPhoto
}
